#intentions-list {
  width: auto;
  display: inline-block;
  min-width: 200px;
  max-width: 800px;
  padding: 0;
  overflow: hidden;
  color: rgba(251, 241, 199, 0.65);
}
#intentions-list li {
  padding: 0 10px;
}
#intentions-list ol {
  overflow-y: hidden;
  margin-top: 0px;
}
#intentions-list.intentions-scroll ol {
  overflow-y: scroll;
}
intention-inline {
  position: absolute;
  margin-top: 0.1em;
  text-decoration: underline;
}
